#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <time.h>
#define TAM 10000000

struct Celula{
    char garbage;
    unsigned int tipo;
    struct Celula *direita, *esquerda;
};

struct Argumento{
    char *tipo;
    struct Argumento *direita, *esquerda, *proximo;
};

struct Stack{
    struct Argumento *cell;
};

struct Pilha{
    struct Celula *cell;
};

struct Celula heap[TAM];
struct Celula *free_list;
struct Celula *raiz;
struct Stack pilha_p[TAM];
struct Stack *pilha;
int celulas;

void alocar_memoria(){
    //heap = (Celula*) calloc(100, sizeof(Celula));
    int i;
    for(i = 0; i < TAM-1;i++)
        (heap+i)->direita = (heap+i+1);
    (heap+i)->direita = 0;
    free_list = heap;
    pilha = pilha_p;
    raiz = NULL;
    celulas = TAM;
}

struct Celula* alocar_celula(unsigned int tipo){
    if(!free_list){
        printf("sem memoria");
        exit(0);
    }
    struct Celula *alocado = free_list;
    free_list = free_list->direita;
    alocado->direita = 0;
    alocado->tipo = tipo;
    celulas--;
    return alocado;
}
