struct Celula* eval(struct Celula *aux){
    struct Pilha *p2 = p++;
    p->cell = 0;
    p++;
    p->cell = 0;
    struct Celula *raiz_aux = raiz;
    raiz = aux;
    buscar_reduz(aux);
    while(raiz->tipo == -2){
        switch (p->cell->tipo){
            case -4:
                reduz_K();
                break;
            case -3:
                reduz_S();
                break;
            case -5:
                reduz_I();
                break;
            case -6:
                reduz_B();
                break;
            case -7:
                reduz_C();
                break;
            case -8:
                reduz_D();
                break;
            case -9:
                reduz_E();
                break;
            case -10:
                reduz_F();
                break;
            case -11:
                reduz_TRUE();
                break;
            case -12:
                reduz_FALSE();
                break;
            case -13:
                reduz_maior_que();
                break;
            case -14:
                reduz_maior_igual_que();
                break;
            case -15:
                reduz_menor_que();
                break;
            case -16:
                reduz_menor_igual_que();
                break;
            case -17:
                reduz_igual();
                break;
            case -18:
                reduz_soma();
                break;
            case -19:
                reduz_subtracao();
                break;
            case -20:
                reduz_multiplicacao();
                break;;
            case -21:
                reduz_divisao();
                break;
            case -22:
                reduz_Y();
                break;
        }
        buscar_reduz(p->cell->esquerda);
    }
    p = p2;
    aux = raiz;
    raiz = raiz_aux;
    return aux;
}
